                WriteLiteral(@"
                            </div> 

                            <div class=""form-group form-check texto-autorizo"">
                                <label class=""form-check-label"">
                                    <input class=""form-check-input"" type=""checkbox"" name=""remember"" required> Concordo com os 
                                    <button type=""button"" class=""btn btn-link cor-secundaria"" data-toggle=""modal"" data-target="".bd-example-modal-lg"" style=""text-decoration: underline;"">Termos, Política de Dados e Política de Cookies.</button>
                                    <div class=""modal fade bd-example-modal-lg"" tabindex=""-1"" role=""dialog"" aria-labelledby=""myLargeModalLabel"" aria-hidden=""true"">
                                        <div class=""modal-dialog modal-lg"">
                                            <div class=""modal-content"">
                                                <div class=""modal-header"">
                                                    <h5 class=""modal-title");
                WriteLiteral(@" cor-principal titulo-principal"" id=""exampleModalLabel"">Política Privacidade</h5>
                                                    <button type=""button"" class=""close"" data-dismiss=""modal"" aria-label=""Close"">
                                                    <span aria-hidden=""true"">&times;</span>
                                                    </button>
                                                </div>
                                                <div class=""modal-body cor-principal text-justify"">                   
                                                    <p class=""mx-4"">A sua privacidade é importante para nós. É política do Black Code Brasil respeitar a sua privacidade em relação a qualquer informação sua que possamos coletar no site <a href=www.blackcodebrasil.com.br>Black Code Brasil</a>, e outros sites que possuímos e operamos.</p>                    
                                                    <p class=""mx-4"">Solicitamos informações pessoais apenas quando realm");
                WriteLiteral(@"ente precisamos delas para lhe fornecer um serviço. Fazemo-lo por meios justos e legais, com o seu conhecimento e consentimento. Também informamos por que estamos coletando e como será usado.</p>                    
                                                    <p class=""mx-4"">Apenas retemos as informações coletadas pelo tempo necessário para fornecer o serviço solicitado. Quando armazenamos dados, protegemos dentro de meios comercialmente aceitáveis ​​para evitar perdas e roubos, bem como acesso, divulgação, cópia, uso ou modificação não autorizados.</p>                    
                                                    <p class=""mx-4"">Não compartilhamos informações de identificação pessoal publicamente ou com terceiros, exceto quando exigido por lei.</p>                    
                                                    <p class=""mx-4"">O nosso site pode ter links para sites externos que não são operados por nós. Esteja ciente de que não temos controle sobre o conteúdo e práticas desses si");
                WriteLiteral(@"tes e não podemos aceitar responsabilidade por suas respectivas <a href='https://politicaprivacidade.com' target='_BLANK'>políticas de privacidade</a>.</p>                    
                                                    <p class=""mx-4"">Você é livre para recusar a nossa solicitação de informações pessoais, entendendo que talvez não possamos fornecer alguns dos serviços desejados.</p>                    
                                                    <p class=""mx-4"">O uso continuado de nosso site será considerado como aceitação de nossas práticas em torno de privacidade e informações pessoais. Se você tiver alguma dúvida sobre como lidamos com dados do usuário e informações pessoais, entre em contacto connosco.</p>                    
                                                    <h2 class=""mx-4"">Política de Cookies Black Code Brasil</h2>                    
                                                    <h3 class=""mx-4"">O que são cookies?</h3>                    
                  ");
                WriteLiteral(@"                                  <p class=""mx-4"">Como é prática comum em quase todos os sites profissionais, este site usa cookies, que são pequenos arquivos baixados no seu computador, para melhorar sua experiência. Esta página descreve quais informações eles coletam, como as usamos e por que às vezes precisamos armazenar esses cookies. Também compartilharemos como você pode impedir que esses cookies sejam armazenados, no entanto, isso pode fazer o downgrade ou 'quebrar' certos elementos da funcionalidade do site.</p>                    
                                                    <h3 class=""mx-4"">Como usamos os cookies?</h3>                    
                                                    <p class=""mx-4"">Utilizamos cookies por vários motivos, detalhados abaixo. Infelizmente, na maioria dos casos, não existem opções padrão do setor para desativar os cookies sem desativar completamente a funcionalidade e os recursos que eles adicionam a este site. É recomendável que você deixe todos os cooki");
                WriteLiteral(@"es se não tiver certeza se precisa ou não deles, caso sejam usados ​​para fornecer um serviço que você usa.</p>                    
                                                    <h3 class=""mx-4"">Desativar cookies</h3>                    
                                                    <p class=""mx-4"">Você pode impedir a configuração de cookies ajustando as configurações do seu navegador (consulte a Ajuda do navegador para saber como fazer isso). Esteja ciente de que a desativação de cookies afetará a funcionalidade deste e de muitos outros sites que você visita. A desativação de cookies geralmente resultará na desativação de determinadas funcionalidades e recursos deste site. Portanto, é recomendável que você não desative os cookies.</p>                    
                                                    <h3 class=""mx-4"">Cookies que definimos</h3>                    
                                                    <ul>                        
                                            ");
                WriteLiteral(@"            <li class=""mx-5"">
                                                            Cookies relacionados à conta
                                                            <br>
                                                            <br> 
                                                            Se você criar uma conta connosco, usaremos cookies para o gerenciamento do processo de inscrição e administração geral. Esses cookies geralmente serão excluídos quando você sair do sistema, porém, em alguns casos, eles poderão permanecer posteriormente para lembrar as preferências do seu site ao sair.
                                                            <br>
                                                            <br>                        
                                                        </li>                        
                                                        <li class=""mx-5"">                            
                                                            ");
                WriteLiteral(@"Cookies relacionados ao login
                                                            <br>
                                                            <br> 
                                                            Utilizamos cookies quando você está logado, para que possamos lembrar dessa ação. Isso evita que você precise fazer login sempre que visitar uma nova página. Esses cookies são normalmente removidos ou limpos quando você efetua logout para garantir que você possa acessar apenas a recursos e áreas restritas ao efetuar login.
                                                            <br>
                                                            <br>                        
                                                        </li>                        
                                                        <li class=""mx-5"">                            
                                                            Cookies relacionados a boletins por e-mail
                        ");
                WriteLiteral(@"                                    <br>
                                                            <br> 
                                                            Este site oferece serviços de assinatura de boletim informativo ou e-mail e os cookies podem ser usados ​​para lembrar se você já está registrado e se deve mostrar determinadas notificações válidas apenas para usuários inscritos / não inscritos.
                                                            <br>
                                                            <br>                        
                                                        </li>                        
                                                        <li class=""mx-5"">                            
                                                            Pedidos processando cookies relacionados
                                                            <br>
                                                            <br> 
                           ");
                WriteLiteral(@"                                 Este site oferece facilidades de comércio eletrônico ou pagamento e alguns cookies são essenciais para garantir que seu pedido seja lembrado entre as páginas, para que possamos processá-lo adequadamente.
                                                            <br>
                                                            <br>                        
                                                        </li>                        
                                                        <li class=""mx-5"">                            
                                                            Cookies relacionados a pesquisas
                                                            <br>
                                                            <br> 
                                                            Periodicamente, oferecemos pesquisas e questionários para fornecer informações interessantes, ferramentas úteis ou para entender nossa base de usuários c");
                WriteLiteral(@"om mais precisão. Essas pesquisas podem usar cookies para lembrar quem já participou numa pesquisa ou para fornecer resultados precisos após a alteração das páginas.
                                                            <br>
                                                            <br>                        
                                                        </li>                        
                                                        <li class=""mx-5"">                            
                                                            Cookies relacionados a formulários
                                                            <br>
                                                            <br> 
                                                            Quando você envia dados por meio de um formulário como os encontrados nas páginas de contacto ou nos formulários de comentários, os cookies podem ser configurados para lembrar os detalhes do usuário para correspondência fu");
                WriteLiteral(@"tura.
                                                            <br>
                                                            <br>                        
                                                        </li>                        
                                                        <li class=""mx-5"">                            
                                                            Cookies de preferências do site
                                                            <br>
                                                            <br> 
                                                            Para proporcionar uma ótima experiência neste site, fornecemos a funcionalidade para definir suas preferências de como esse site é executado quando você o usa. Para lembrar suas preferências, precisamos definir cookies para que essas informações possam ser chamadas sempre que você interagir com uma página for afetada por suas preferências.
                                          ");
                WriteLiteral(@"                  <br>                        
                                                        </li>                    
                                                    </ul>                    
                                                    <h3 class=""mx-4"">Cookies de Terceiros</h3>                    
                                                    <p class=""mx-4"">Em alguns casos especiais, também usamos cookies fornecidos por terceiros confiáveis. A seção a seguir detalha quais cookies de terceiros você pode encontrar através deste site.</p>                   
                                                    <ul>                        
                                                        <li class=""mx-5"">                            
                                                            Este site usa o Google Analytics, que é uma das soluções de análise mais difundidas e confiáveis ​​da Web, para nos ajudar a entender como você usa o site e como podemos melhorar sua ");
                WriteLiteral(@"experiência. Esses cookies podem rastrear itens como quanto tempo você gasta no site e as páginas visitadas, para que possamos continuar produzindo conteúdo atraente.                        
                                                        </li>                    
                                                    </ul>                    
                                                    <p class=""mx-4"">Para mais informações sobre cookies do Google Analytics, consulte a página oficial do Google Analytics.</p>                    
                                                    <ul>                        
                                                        <li class=""mx-5"">                            
                                                            As análises de terceiros são usadas para rastrear e medir o uso deste site, para que possamos continuar produzindo conteúdo atrativo. Esses cookies podem rastrear itens como o tempo que você passa no site ou as páginas visitadas");
                WriteLiteral(@", o que nos ajuda a entender como podemos melhorar o site para você.
